/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  `privilege` enum('Bisu-Admin','Congressional-Admin','super-admin') DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

/*Data for the table `users` */

insert  into `users`(`id`,`username`,`password`,`is_active`,`privilege`) values (1,'admin','d033e22ae348aeb5660fc2140aec35850c4da997',1,'super-admin'),(2,'test','d033e22ae348aeb5660fc2140aec35850c4da997',0,'super-admin'),(3,'admin-bisu','da39a3ee5e6b4b0d3255bfef95601890afd80709',1,'Bisu-Admin');

/* Procedure structure for procedure `sp_books_add` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_books_add` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_books_add`(
	_title varchar (255),
	_author varchar (255),
	_place_and_publisher varchar(255),
	_section varchar (50),
	_call_no varchar (255),
	_account_no varchar (255),
	_no_of_copies int (11),
	_edition varchar (50),
	_cost_price float (12,2),
	_copyright_year year,
	_type varchar (50)
    )
BEGIN
	INSERT INTO `books` (`title`,`author`,`place_and_publisher`,`section`,`call_no`,`account_no`,`no_of_copies`,`edition`,`cost_price`,`copyright_year`,`type`)
	VALUES (_title, _author, _place_and_publisher,_section,_call_no,_account_no,_no_of_copies,_edition,_cost_price,_copyright_year,_type);
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_books_edit` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_books_edit` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_books_edit`(
	_title VARCHAR (255),
	_author VARCHAR (255),
	_place_and_publisher VARCHAR(255),
	_section VARCHAR (50),
	_call_no VARCHAR (255),
	_account_no VARCHAR (255),
	_no_of_copies INT (11),
	_edition VARCHAR (50),
	_cost_price FLOAT (12,2),
	_copyright_year YEAR,
	_edit_id int (11)
    )
BEGIN
	UPDATE books SET `section` =_section, `call_no`=_call_no, `account_no`=_account_no, `no_of_copies`=_no_of_copies, `author`=_author, `title`=_title, 
	`place_and_publisher`=_place_and_publisher,`edition`=_edition, `cost_price`=_cost_price, `copyright_year`=_copyright_year WHERE
	id = _edit_id;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_books_get` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_books_get` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_books_get`(
	_type varchar (255)
)
BEGIN
	SELECT * FROM `books` b WHERE b.`type` = "Bisu";
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_get_all_users` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_get_all_users` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_get_all_users`(
	_username varchar (255)
    )
BEGIN
	SELECT * FROM `users` u WHERE u.`username` <> _username;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_registered_borrowers_add` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_registered_borrowers_add` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_registered_borrowers_add`(
	_first_name varchar (255),
	_middle_name varchar (50),
	_last_name varchar (255),
	_sex varchar (25),
	_course varchar (50),
	_year varchar (25),
	_section varchar (50),
	_image longblob
    )
BEGIN
	INSERT INTO `registered_borrowers` (first_name,middle_name,last_name,sex,course,`year`,section,image)
	VALUES (_first_name,_middle_name,_last_name,_sex,_course,_year,_section,_image);
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_registered_borrowers_edit` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_registered_borrowers_edit` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_registered_borrowers_edit`(
	_first_name VARCHAR (255),
	_middle_name VARCHAR (50),
	_last_name VARCHAR (255),
	_sex VARCHAR (25),
	_course VARCHAR (50),
	_year VARCHAR (25),
	_section VARCHAR (50),
	_image LONGBLOB,
	_edit_id int (11)
    )
BEGIN
	UPDATE `registered_borrowers` SET first_name = _first_name, `middle_name` = _middle_name,
	`last_name` = _last_name,`sex` = _sex, `course` = _course, `year` = _year, `section` = _section,
	image = _image WHERE id = _edit_id;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_registered_borrowers_get` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_registered_borrowers_get` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_registered_borrowers_get`(
	_type varchar (50)
)
BEGIN
	SELECT rb.id, rb.`first_name`,rb.`middle_name`,rb.`last_name`,CONCAT(rb.`last_name`, ", ",rb.`first_name`, " ", UPPER(SUBSTRING(rb.`middle_name`,1,1)),".") AS `name`,
	rb.`sex`, rb.`course`, CONCAT(rb.year," - ", rb.`section`) AS year_and_section, date_format(rb.`transdate`, "%M %d, %Y") as added_on, rb.section, rb.year,rb.image
	FROM `registered_borrowers` rb WHERE rb.`type` = _type;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_users_add` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_users_add` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_users_add`(
	_username varchar (255),
	_password VARCHAR (255),
	_privilege varchar (255)
    )
BEGIN
	INSERT INTO `users` (username, `password`, privilege)
	VALUES (_username, SHA1(_password), _privilege); 
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_users_edit` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_users_edit` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_users_edit`(
	_username varchar (255),
	_password varchar (255),
	_privilege varchar (255),
	_id int (11)
    )
BEGIN
	UPDATE users SET username = _username,  `password` = SHA1(_password), privilege = _privilege
	WHERE id = _id;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_users_login` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_users_login` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_users_login`(
	_username varchar (255),
	_password varchar (255)
    )
BEGIN
	SELECT * FROM `users` WHERE username = _username AND `password` = SHA1(_password) AND is_active =1;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_user_update_active_status` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_user_update_active_status` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_user_update_active_status`(
	_id int (11),
	_mode tinyint(1)
    )
BEGIN
	UPDATE users SET is_active = _mode WHERE id = _id;
    END */$$
DELIMITER ;

